:{"id":"2033932"},"source":{"id":"2033962"},"volume_range":{"id":"2034169"}},"code":"if (!window._bt_scale_range) {\n    window._bt_scale_range = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2034281","type":"CustomJS"},{"attributes":{"line_color":"red","line_width":2,"x":{"field":"x"},"y":{"value":1.004139868}},"id":"2034090","type":"Line"},{"attributes":{"data":{"Close":{"__ndarray__":"exSuR+FqXkAAAAAAAKBdQJqZmZmZyV1AFK5H4XoEXkAUrkfhesRdQGZmZmZmBl5AKVyPwvXoXUAzMzMzMyNeQIXrUbgeNV5AAAAAAABgXkBxPQrXo2BeQOF6FK5HIV5AKVyPwvUIXkBxPQrXoyBeQMP1KFyPgl5A4XoUrkfBXED2KFyPwpVcQM3MzMzMjFxAcT0K16PAXEDNzMzMzGxdQNejcD0KV11A4XoUrkdxXUC4HoXrUVhdQM3MzMzM/FxA4XoUrkdRXUDhehSuR3FdQNejcD0Kl11APQrXo3CtXUAK16NwPVpdQB+F61G4nl1AzczMzMysXUDXo3A9CnddQI/C9Shcr11AXI/C9SisXUBSuB6F6yFdQM3MzMzM/FxAXI/C9SgsXUDXo3A9CudcQI/C9ShcP11AH4XrUbi+XECamZmZmYlcQI/C9Shc31xAuB6F61EIXUD
